import React from 'react';

import { useParams } from 'react-router-dom';

const Quotesdetail = () => {

    const params = useParams();

    return (
        <div>
            <h1>Quotes Detail Page</h1>
            <p>{params.quoteId}</p>
        </div>
    );
}

export default Quotesdetail;
